import { FaHome, FaSignOutAlt, FaRupeeSign, FaBitcoin, FaPiggyBank, FaBook, FaCalendarAlt, FaCreditCard, FaChartLine, FaChartBar, FaCommentAlt, FaTrash, FaPlus, FaMinus, FaCog, FaUser, FaUsers, FaYoutube, FaTv, FaHamburger, FaShirt, FaBriefcaseMedical, FaBriefcase, FaShoppingBag, FaCircle, FaChartPie } from 'react-icons/fa';

export const home = <FaHome />;
export const signout = <FaSignOutAlt />;
export const rupee = <FaRupeeSign />;
export const bitcoin = <FaBitcoin />;
export const piggy = <FaPiggyBank />;
export const book = <FaBook />;
export const calender = <FaCalendarAlt />;
export const card = <FaCreditCard />;
export const trend = <FaChartLine />;
export const dashboard = <FaChartBar />;
export const comment = <FaCommentAlt />;
export const trash = <FaTrash />;
export const plus = <FaPlus />;
export const minus = <FaMinus />;
export const settings = <FaCog />;
export const user = <FaUser />;
export const users = <FaUsers />;
export const yt = <FaYoutube />;
export const tv = <FaTv />;
export const food = <FaHamburger />;
export const clothing = <FaShirt />;
export const medical = <FaBriefcaseMedical />;
export const freelance = <FaBriefcase />;
export const takeaway = <FaShoppingBag />;
export const circle = <FaCircle />;
export const transactions = <FaChartPie />;
export const expenses = <FaChartBar />;
export const accounts = <FaUser />;
export const categories = <FaCircle />;
export const money = <FaRupeeSign />;
export const stocks = <FaChartLine />;
export const logout = <FaSignOutAlt />;
